import React from 'react'
import Card from './Card'

// We  destructure a users variable from 
// the users to object
import { users } from './Users';

function CardList(props) {
    return (
        <div>
            <Card name={users[0].name} email={users[0].email} />
            <Card name={users[1].name} email={users[1].email} />
            <Card name={users[2].name} email={users[2].email} />
            <Card name={users[3].name} email={users[3].email} />
            <Card name={users[4].name} email={users[4].email} />
            <Card name={users[5].name} email={users[5].email} />
            <Card name={users[6].name} email={users[6].email} />
            <Card name={users[7].name} email={users[7].email} />
            <Card name={users[8].name} email={users[8].email} />
            <Card name={users[9].name} email={users[9].email} />
        </div>
    );
}

export default CardList
